The problem was that the attribute options for attribute package_type where removed/missing.

Still we are not sure why this has happened.
{{select * from eav_attribute_option_value where option_id in ( SELECT option_id FROM eav_attribute_option where attribute_id = 132);}}
The values are coming from upgrade script not from pcat files, it is not clear how the values have been altered. However these tables are part of the pcatexport so we just restored the st9 pcat to the environments that have a problem. This way the correct attribute options are available and after running the import process again we see the issue is no longer observed.
 
